import styled from "styled-components"

export const TripsCard = styled.div `
box-sizing: border-box;
display: grid;
box-shadow: rgb(0 0 0 / 30%) 0px 4px 8px 0px;
padding: 10px 20px;
border-radius: 4px;
margin: 10px 0px;
max-width: 300px;
width: 100%;

.column {
  float: left;
  width: 25%;
  padding: 0 10px;


`
